import React from 'react'

function Login() {
    return (
        <div className="login">
            <h1>This is login page</h1>
            <img src="https://getheavy.com/wp-content/uploads/2019/12/spotify2019-830x350.jpg" alt="" />
            <button>LOGIN WITH SPOTIFY</button>
        </div>
    )
}

export default Login
